import React from "react";
import { Component } from "react";
import classes from "./Navbar.module.css";

class Navbar extends Component {
  render() {
    return (
      <div className={classes.header}>
        <nav>
          <ul className={classes.nav__links}>
            <li>
              <a href=""></a>
              <a href=""></a>
              <a href=""></a>
            </li>
          </ul>
        </nav>
      </div>
    );
  }
}

export default Navbar;
